@beautypie is like a super luxury version of Costco. Your membership gets you the most impressive, high tech products made in the same labs as the big names but for a fraction of the price because they cut out the middleman. I'm also loving that they package it in a fully recyclable tub rather than individual packets!! 

@beautypie knows that beauty starts on the inside and so they just launched supplements! Their Collagen contains twice as high of a dose as many others, of pure Hydrolyzed Marine Collagen per serving (plus Biotin, Tremella Fuciformis and a nice symbiotic dose of Vitamin C). Use my code AURORASENTME to get your first month of your @beautypie shopping membership free! 

Pb&j Smoothie recipe (coconut butter, blueberries, avocado, cinnamon, banana, almond milk, powdered peanut butter, ice and @beautypie raspberry collagen super powder)

